INSERT INTO `oc_information_description` VALUES (5,4,'Termos e condições','&lt;div class=&quot;about-page&quot;&gt;\r\n&lt;div class=&quot;about-page&quot; style=&quot;font-size: 13px; line-height: 20.7999992370605px;&quot;&gt;\r\n&lt;div class=&quot;about-page&quot; style=&quot;font-size: 13px; line-height: 20.7999992370605px;&quot;&gt;\r\n&lt;div class=&quot;about-page&quot; style=&quot;font-size: 13px; line-height: 20.7999992370605px;&quot;&gt;&lt;i class=&quot;fa fa-thumbs-up&quot;&gt;&amp;nbsp;&lt;/i&gt;\r\n&lt;div class=&quot;extra-wrap&quot;&gt;\r\n&lt;h3&gt;Termos e Condições&amp;nbsp;&lt;/h3&gt;\r\n\r\n&lt;p&gt;A alfabetoauto.com.br reserva-se no direito de corrigir ou alterar informações e preços a qualquer momento. Em caso de dúvida entre em contato conosco. Todas as Fotos do nosso site são meramente ilustrativas e as ofertas válidas enquanto durarem os estoques.&lt;/p&gt;\r\n\r\n&lt;p&gt;Todos os custos de instalação e desinstalação dos produtos ficam a encargo do comprador!&lt;/p&gt;\r\n\r\n&lt;p&gt;Não nos responsabilizamos por instalações mal executadas!&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div class=&quot;about-page&quot; style=&quot;font-size: 13px; line-height: 20.7999992370605px;&quot;&gt;&lt;i class=&quot;fa fa-clock-o&quot;&gt;&amp;nbsp;&lt;/i&gt;\r\n\r\n&lt;div class=&quot;extra-wrap&quot;&gt;\r\n&lt;h3&gt;Prazo de envio&lt;/h3&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px; line-height: 20.7999992370605px;&quot;&gt;A alfabetoauto.com.br possui produtos em estoque e produtos que são fabricados por demanda, devido aos processos necessários na fabricação&amp;nbsp;o prazo de envio pode ser&amp;nbsp;maior para esses produtos que ainda serão fabricados.&amp;nbsp;É&amp;nbsp;informado na página de cada produto&amp;nbsp;o prazo de envio.&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div class=&quot;about-page&quot; style=&quot;font-size: 13px; line-height: 20.7999992370605px;&quot;&gt;&lt;i class=&quot;fa fa-gift&quot;&gt;&amp;nbsp;&lt;/i&gt;\r\n\r\n&lt;div class=&quot;extra-wrap&quot;&gt;\r\n&lt;h3&gt;Vale Presente&lt;/h3&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px; line-height: 20.7999992370605px;&quot;&gt;Com o Vale Presente Alfabetoauto você pode escolher qualquer produto do site, é a solução ideal para quem quer presentear sem errar na escolha!&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px; line-height: 20.7999992370605px;&quot;&gt;Caso o valor da compra seja maior que o valor do vale, é possível complementar o pagamento.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px; line-height: 20.7999992370605px;&quot;&gt;Regras de utilização:&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px; line-height: 20.7999992370605px;&quot;&gt;- Uso exclusivo no site.&lt;br /&gt;\r\n- O vale presente poderá ser utilizado várias vezes até zerar o saldo e dentro do prazo de validade.&lt;br /&gt;\r\n- Caso o valor total do vale não seja utilizado dentro do prazo de validade, não será possível a revalidação do mesmo.&lt;br /&gt;\r\n- A validade do vale é de 90 dias corridos contados a partir da data de recebimento.&lt;br /&gt;\r\n- É permitido o uso de vários vales por pedido.&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div class=&quot;about-page&quot; style=&quot;font-size: 13px; line-height: 20.7999992370605px;&quot;&gt;&lt;i class=&quot;fa fa-refresh&quot;&gt;&amp;nbsp;&lt;/i&gt;\r\n\r\n&lt;div class=&quot;extra-wrap&quot;&gt;\r\n&lt;h3&gt;Trocas e devoluções&lt;/h3&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px; line-height: 20.7999992370605px;&quot;&gt;As solicitações de troca deverão ser comunicadas à Central de Atendimento (atendimento@alfabetoauto.com.br) no prazo de até 30 (trinta) dias corridos, a partir da data do recebimento do produto.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px; line-height: 20.7999992370605px;&quot;&gt;As trocas só serão efetuadas mediante constatação de defeito de fabricação, no caso de problemas por mau uso o produto será enviado para assistência técnica que fará o reparo, caso seja possível e, os custos serão cobrados do cliente.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px; line-height: 20.7999992370605px;&quot;&gt;Quanto às devoluções para restituição dos valores pagos, estas deverão ser solicitadas no prazo de até 7 (sete) dias corridos, a partir da data do recebimento do produto.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px; line-height: 20.7999992370605px;&quot;&gt;Os produtos devolvidos sem prévia comunicação serão imediatamente reenviados ao cliente.&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div class=&quot;about-page&quot; style=&quot;font-size: 13px; line-height: 20.7999992370605px;&quot;&gt;&lt;i class=&quot;fa fa-truck&quot;&gt;&amp;nbsp;&lt;/i&gt;\r\n\r\n&lt;div class=&quot;extra-wrap&quot;&gt;\r\n&lt;h3&gt;Formas de envio&lt;/h3&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px; line-height: 20.7999992370605px;&quot;&gt;Os produtos apresentados em nosso website se encontram no Brasil e são enviados diretamente para o endereço do cliente. O envio destas mercadorias se dá através dos Correios, modalidade que possui três formas de entrega PAC, Sedex e E-Sedex, no qual o prazo de entrega conta a partir da postagem do pedido.&lt;br /&gt;\r\n&amp;nbsp;&lt;br /&gt;\r\nPara sua segurança, recomendamos que antes de assinar o aviso de recebimento entregue pelos Correios, abra o pacote e certifique-se de que não há nenhuma divergência entre o produto comprado e o recebido. Caso perceba qualquer tipo de problema, formalize uma reclamação com o carteiro e negue o recebimento do produto, entrando em contato, logo em seguida, com um de nossos canais de atendimento. Esta providência visa lhe assegurar o direito de garantia sob a mercadoria comprada e, caso não seja tomada, um novo produto não será reenviado e tampouco o cliente será reembolsado com o valor pago pelo mesmo.&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n'),(6,4,'Informações de entrega','&lt;div class=&quot;about-page&quot;&gt;\r\n&lt;div class=&quot;about-page&quot; style=&quot;font-size: 13px; line-height: 20.7999992370605px;&quot;&gt;&amp;nbsp;&lt;/div&gt;\r\n\r\n&lt;div class=&quot;about-page&quot; style=&quot;font-size: 13px; line-height: 20.7999992370605px;&quot;&gt;&lt;i class=&quot;fa fa-clock-o&quot;&gt;&amp;nbsp;&lt;/i&gt;\r\n\r\n&lt;div class=&quot;extra-wrap&quot;&gt;\r\n&lt;h3&gt;Prazo de envio&lt;/h3&gt;\r\n\r\n&lt;p&gt;A &lt;strong&gt;alfabetoauto.com.br&lt;/strong&gt; possui produtos em estoque e produtos que são fabricados por demanda, devido aos processos necessários na fabricação&amp;nbsp;o prazo de envio pode ser&amp;nbsp;maior para esses produtos que ainda serão fabricados.&amp;nbsp;É&amp;nbsp;informado na página de cada produto&amp;nbsp;o prazo de envio.&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div class=&quot;about-page&quot;&gt;&lt;i class=&quot;fa fa-truck&quot;&gt;&amp;nbsp;&lt;/i&gt;\r\n\r\n&lt;div class=&quot;extra-wrap&quot;&gt;\r\n&lt;h3&gt;Formas de envio&lt;/h3&gt;\r\n\r\n&lt;p&gt;Os produtos apresentados em nosso website se encontram no Brasil e são enviados diretamente para o endereço do cliente. O envio destas mercadorias se dá através dos Correios, modalidade que possui três formas de entrega PAC, Sedex e E-Sedex, no qual o prazo de entrega conta a partir da postagem do pedido.&lt;br /&gt;\r\n&amp;nbsp;&lt;br /&gt;\r\nPara sua segurança, recomendamos que antes de assinar o aviso de recebimento entregue pelos Correios, abra o pacote e certifique-se de que não há nenhuma divergência entre o produto comprado e o recebido. Caso perceba qualquer tipo de problema, formalize uma reclamação com o carteiro e negue o recebimento do produto, entrando em contato, logo em seguida, com um de nossos canais de atendimento. Esta providência visa lhe assegurar o direito de garantia sob a mercadoria comprada e, caso não seja tomada, um novo produto não será reenviado e tampouco o cliente será reembolsado com o valor pago pelo mesmo.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin:0cm;margin-bottom:.0001pt&quot;&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n'),(4,4,'Quem somos','&lt;div class=&quot;about-page&quot;&gt;\r\n&lt;div class=&quot;about-page&quot; style=&quot;font-size: 13px; line-height: 20.7999992370605px;&quot;&gt;\r\n&lt;div class=&quot;extra-wrap&quot;&gt;\r\n&lt;p&gt;A &lt;strong&gt;alfabetoauto.com.br&lt;/strong&gt; é uma empresa especializada em vendas online que comercializa uma diversificada seleção de produtos relacionados ao setor Automotivo.&lt;br /&gt;\r\n&amp;nbsp;&lt;br /&gt;\r\n&lt;strong&gt;Missão:&lt;/strong&gt;&amp;nbsp;Ser uma empresa &quot;em movimento&quot;, procurando utilizar e se adaptar as mudanças do mercado em que atua visando sempre as melhores práticas para gerar crescimento na participação de seu mercado e a satisfação de seus clientes e colaboradores.&lt;br /&gt;\r\n&amp;nbsp;&lt;br /&gt;\r\n&lt;strong&gt;Visão:&lt;/strong&gt;&amp;nbsp;Trabalhar com ética e respeito com nossos clientes, colaboradores e fornecedores; para o crescimento da empresa.&lt;br /&gt;\r\n&amp;nbsp;&lt;br /&gt;\r\n&lt;strong&gt;Valores:&lt;/strong&gt;&amp;nbsp;Respeito, motivação, honestidade, simplicidade de processos e crescimento.&lt;br /&gt;\r\n&amp;nbsp;&lt;br /&gt;\r\nNa alfabetoauto.com.br o cliente pode:&lt;/p&gt;\r\n\r\n&lt;p&gt;- Pesquisar toda a variedade de produtos presentes em nossos departamentos através de ferramentas de busca que localizam o que for preciso por marca, título ou preço, de forma simples e eficaz.&lt;br /&gt;\r\n- Navegar em cada categoria de produtos ou conferir somente nossas promoções e lançamentos.&lt;br /&gt;\r\n- Consultar prazos de entrega.&lt;br /&gt;\r\n- Cadastrar-se para receber semanalmente e-mails com promoções e ofertas.&lt;br /&gt;\r\n- Tirar dúvidas, fazer sugestões, elogios ou reclamações sobre nossos produtos e serviços nos canais de atendimento.&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div class=&quot;about-page&quot; style=&quot;font-size: 13px; line-height: 20.7999992370605px;&quot;&gt;&amp;nbsp;\r\n&lt;div class=&quot;extra-wrap&quot;&gt;\r\n&lt;h3&gt;&amp;nbsp;&lt;/h3&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div class=&quot;about-page&quot;&gt;\r\n&lt;div class=&quot;extra-wrap&quot;&gt;\r\n&lt;div&gt;&amp;nbsp;&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n'),(3,4,'Políticas de privacidade','&lt;div class=&quot;about-page&quot;&gt;\r\n&lt;div class=&quot;extra-wrap&quot;&gt;\r\n&lt;p&gt;A &lt;strong&gt;Alfabetoauto.com.br &lt;/strong&gt;garante segurança e privacidade de identidade aos internautas que fazem compras na loja virtual. Dados cadastrados como nome, endereço e número de cartão de crédito são protegidos por sistemas avançados de criptografia&amp;nbsp;enquanto são enviados, e mantidos em sigilo em servidores seguros da &lt;strong&gt;Alfabetoauto.com.br.&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;O site Alfabetoauto.com.br tem adotado os níveis legalmente requeridos quanto à segurança na proteção de dados, tendo instalado todos os meios e medidas técnicas ao seu alcance para evitar a perda, mau uso, alteração, acesso não autorizado ou subtração indevida dos Dados Pessoais recolhidos. Não obstante, o usuário deve estar ciente de que as medidas de segurança relativas à Internet não são integralmente infalíveis.&lt;/p&gt;\r\n\r\n&lt;p&gt;A Alfabetoauto.com.br reserva-se o direito de modificar a presente política para adaptá-la a alterações legislativas ou jurisprudências, ou aquelas relativas às práticas comerciais. Em qualquer caso, a Alfabetoauto.com.br anunciará no site, por meio desta página, as mudanças introduzidas com uma antecedência razoável à sua colocação em prática.&lt;/p&gt;\r\n\r\n&lt;p&gt;Os Usuários poderão exercer os direitos de acesso, cancelamento, retificação e oposição, bem como têm reconhecido o direito de obterem informações contatando a Alfabetoauto.com.br pelo link Central de Atendimento ou diretamente pelo telefone (21) 4124-6721.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Coleta de Informações&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Ao se cadastrar, os clientes determinam voluntariamente que desejam fornecer os seus Dados Pessoais requeridos na contratação, atualização ou cancelamento de determinados serviços oferecidos no site ou através dele, tais como: compras na loja virtual, contatos com os serviços de atendimento e outros.&lt;/p&gt;\r\n\r\n&lt;p&gt;Os Dados Pessoais recolhidos pela Alfabetoauto.com.br serão objeto de tratamento automatizado, sendo incorporados aos correspondentes registros eletrônicos de dados pessoais, dos quais a Alfabetoauto.com.br será titular e responsável. Os dados obtidos e utilizados pela Alfabetoauto.com.br, bem como pelos parceiros contratados pela Alfabetoauto.com.br para os serviços oferecidos no site fazem parte dessa política.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Utilização das Informações&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;As informações pessoais fornecidas pelos clientes são utilizadas com o propósito básico de identificar o público usuário, seu perfil e hábitos de compra, para gestão, administração, atendimento, ampliação e melhorias nos produtos e serviços oferecidos; também para a adequação dos serviços às preferências e gostos dos usuários, para a criação de novos produtos e serviços, para o envio de informações operacionais e comerciais relativas aos produtos e serviços, por meios tradicionais e/ou eletrônicos.&lt;/p&gt;\r\n\r\n&lt;p&gt;A &lt;strong&gt;Alfabetoauto.com.br&lt;/strong&gt; se compromete a:&lt;/p&gt;\r\n\r\n&lt;p&gt;– Corrigir prontamente quaisquer alterações relativas aos Dados Pessoais do Usuário. Para tanto, o Usuário deverá informar a Alfabetoauto.com.br toda mudança nos respectivos dados;&lt;/p&gt;\r\n\r\n&lt;p&gt;– Não divulgar sem prévia autorização, em hipótese alguma, o e-mail do internauta que se cadastrar em páginas que requerem preenchimento de dados pessoais;&lt;/p&gt;\r\n\r\n&lt;p&gt;– Possibilitar ao internauta o cancelamento, a qualquer momento, do envio por e-mail de material informativo solicitado anteriormente;&lt;/p&gt;\r\n\r\n&lt;p&gt;– Não comercializar ou divulgar os dados de seus clientes para outros fins que não sejam para ações da Alfabetoauto.com.br, sejam eles através de contatos de nossa área de relacionamento, ações do programa fidelidade, informações sobre produtos e promoções.&lt;/p&gt;\r\n\r\n&lt;p&gt;A &lt;strong&gt;Alfabetoauto.com.br&lt;/strong&gt; adota como política o compromisso de não divulgar informações sobre os acessos realizados por seus usuários, a menos que seja obrigado a fazê-lo mediante ordem judicial ou no estrito cumprimento de norma legal. Da mesma forma, a Alfabetoauto.com.br mantém confidenciais os dados cadastrais privados de seus usuários, só os revelando a terceiros nos casos em que não haja vedações legais, ou em razão de ordem judicial ou, ainda, mediante autorização de seus titulares.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Histórico de produtos visualizados&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;O site da &lt;strong&gt;Alfabetoauto.com.br&lt;/strong&gt; pode, eventualmente, gravar arquivos de dados chamados &quot;cookies&quot; no computador do usuário. Esses arquivos não ocupam espaço de memória do micro, mas com eles se pode personalizar cada página visualizada por você no site, o que torna sua navegação mais interessante e ágil. No entanto, a desativação da instalação destes arquivos no software de navegação é passível de acontecer, se assim você preferir, ainda que continue a utilizar os serviços que o site oferece.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong style=&quot;line-height: 1.6em;&quot;&gt;E-mail Marketing&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Nossa prática de envio de e-mail marketing está dentro dos padrões estabelecidos pelo Código de Autorregulamentação para Prática de E-mail Marketing (CAPEM) que prevê de acordo com o Capítulo I, Art. 1° a utilização de e-mail como ferramenta de marketing, de forma ética, pertinente e responsável, sem prejuízo da concomitante aplicação da legislação vigente aplicável.&lt;/p&gt;\r\n\r\n&lt;p&gt;O envio de e-mails será feito apenas com o seu consentimento e poderá ser desativado a qualquer momento em um link de descadastro existente dentro das newsletters. No entanto, após requisitar o cancelamento, a &lt;strong&gt;Alfabetoauto.com.br&lt;/strong&gt; poderá levar até sete dias para processar sua solicitação. A &lt;strong&gt;Alfabetoauto.com.br&lt;/strong&gt; é contra o envio de e-mails sem autorização prévia (conhecidos como SPAM). Ao se cadastrar em nosso site, você poderá escolher se deseja ou não receber e-mails com informações e promoções da &lt;strong&gt;Alfabetoauto.com.br&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;A &lt;strong&gt;Alfabetoauto.com.br&lt;/strong&gt; nunca envia e-mails solicitando confirmação de dados/cadastro ou com anexos executáveis (extensão exe, com, scr, bat) e links para download.&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n');
