INSERT INTO `oc_product_description` VALUES (54,4,'Friso Lateral Personalizado Chery Celer','&lt;p style=&quot;box-sizing: border-box; margin: 0px 0px 20px; color: rgb(126, 126, 126); font-family: Roboto, sans-serif; font-size: 13px; line-height: 18px;&quot;&gt;&lt;span style=&quot;font-family: arial, helvetica, sans-serif; font-size: small;&quot;&gt;Friso personalizado com fabricação de altíssima qualidade e com matéria prima da melhor qualidade (Sikkens, AkzoNobel e 3M). Após a fabricação os frisos passam por rigoroso teste de qualidade e inspeção antes de embalado e separado para o estoque.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;ul style=&quot;box-sizing: border-box; margin: 0px; list-style: none; padding-right: 0px; padding-left: 0px; color: rgb(126, 126, 126); font-family: Roboto, sans-serif; font-size: 13px; line-height: 18px;&quot;&gt;\r\n	&lt;li style=&quot;box-sizing: border-box;&quot;&gt;&lt;span style=&quot;box-sizing: border-box;&quot;&gt;&lt;span style=&quot;box-sizing: border-box; font-family: arial, helvetica, sans-serif; font-size: small;&quot;&gt;Mesmos frisos vendidos por grande maioria das concessionárias.&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\r\n	&lt;li style=&quot;box-sizing: border-box;&quot;&gt;&lt;span style=&quot;box-sizing: border-box;&quot;&gt;&lt;span style=&quot;box-sizing: border-box; font-family: arial, helvetica, sans-serif; font-size: small;&quot;&gt;Único com 5 anos de garantia contra defeitos de fabricação.&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\r\n	&lt;li style=&quot;box-sizing: border-box;&quot;&gt;&lt;span style=&quot;box-sizing: border-box;&quot;&gt;&lt;span style=&quot;box-sizing: border-box; font-family: arial, helvetica, sans-serif; font-size: small;&quot;&gt;Mais que o dobro da espessura que a maioria dos concorrentes, cumprindo realmente o papel de proteção.&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\r\n	&lt;li style=&quot;box-sizing: border-box;&quot;&gt;&lt;span style=&quot;box-sizing: border-box;&quot;&gt;&lt;span style=&quot;box-siz