: 18px;&quot;&gt;&lt;span style=&quot;box-sizing: border-box; font-weight: bold; color: rgb(0, 0, 0); font-family: arial, helvetica, sans-serif; font-size: small;&quot;&gt;Características&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; margin: 0px 0px 20px; color: rgb(126, 126, 126); font-family: Roboto, sans-serif; font-size: 13px; line-height: 18px;&quot;&gt;&lt;span style=&quot;box-sizing: border-box; font-size: small;&quot;&gt;&lt;span style=&quot;box-sizing: border-box; font-family: arial, helvetica, sans-serif;&quot;&gt;Os nossos frisos foram desenvolvidos para proteger as portas dos veículos com eficiência e destacando-o dos demais, a peça é preenchida por completo oferecendo maior resistência e proteção do que os frisos ocos. Junto do plástico ABS são adicionados outros compostos para que o friso tenha maior flexibilidade e durabilidade, é possível envergar o friso até que uma ponta encoste uma na outra sem que a pintura seja danificada.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; margin: 0px 0px 20px; color: rgb(126, 126, 126); font-family: Roboto, sans-serif; font-size: 13px; line-height: 18px;&quot;&gt;&lt;span style=&quot;box-sizing: border-box; font-size: small;&quot;&gt;&lt;span style=&quot;box-sizing: border-box; font-family: arial, helvetica, sans-serif;&quot;&gt;&lt;strong style=&quot;box-sizing: border-box;&quot;&gt;&lt;span style=&quot;box-sizing: border-box; color: rgb(0, 0, 0);&quot;&gt;Garantia&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; margin: 0px 0px 20px; color: rgb(126, 126, 126); font-family: Roboto, sans-serif; font-size: 13px; line-height: 18px;&quot;&gt;&lt;span style=&quot;box-sizing: border-box; font-size: small;&quot;&gt;Oferecemos 5 anos de garantia contra defeitos de fabricação.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n','Alfabeto Auto - Produtos Personalizados para Carros de t